function Calculator(){var e={score:{min:5,max:99999,val:100},positive:{min:1,max:97,val:50},step:{num:1,pri:[3,2,4,5]}};var t={1:49,2:12,3:12,4:12,5:11};var n=function(){var n=e.score.val*(e.positive.val/100);if(Math.floor(n)!=n){n=Math.floor(n)}else{n=n-1}var r=Math.floor((e.score.val-n)/4);t[1]=n;t[2]=r-1;t[3]=r-1;t[4]=r-1;t[5]=r-1;var i=t[1]+1+t[2]+1+t[3]+1+t[4]+1+t[5];var s=0;while(i<e.score.val){t[e.step.pri[s]]+=1;i+=1;s+=1;if(s==e.step.pri.length){s=0}}};this.score=function(t){if(!isNaN(parseFloat(t))&&isFinite(t)){if(Math.round(t*1)<e.score.min){e.score.val=Math.round(e.score.min)}else if(Math.round(t*1)>e.score.max){e.score.val=Math.round(e.score.max)}else{e.score.val=Math.round(t*1)}}return e.score.val};this.positive=function(t){if(!isNaN(parseFloat(t))&&isFinite(t)){if(Math.round(t*1)<e.positive.min){e.positive.val=Math.round(e.positive.min,2)}else if(Math.round(t*1)>e.positive.max){e.positive.val=Math.round(e.positive.max,2)}else{e.positive.val=Math.round(t*1,2)}}return e.positive.val};this.refresh=function(e){n();var r={};for(var i=1;i<=5;i++){var s=0;for(var o=1;o<i;o++){if(t[o]>=0){s+=t[o]+1}}r[i]={};r[i].from=s;r[i].to=s+t[i];if(t[i]<0||r[i].from.toString()=="NaN"||r[i].to.toString()=="NaN"){r[i]=false}}if(typeof e=="function"){e.call(this,r)}}}
